import SignIn from "./components/SignIn";

function App() {
  return (
    <div>
      <div className="container">
        <BrowserRouter>
          <Routes>
            <Route path="/" element={<SignIn />} />
          </Routes>
        </BrowserRouter>
      </div>
    </div>
  );
}

export default App;
